-- ----------------------------
-- Table structure for ti_question
-- ----------------------------
DROP TABLE IF EXISTS `ti_question`;
CREATE TABLE `ti_question`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '题目ID',
  `question_type` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'A' COMMENT '题型（A 选择题，B 填空题 ,C 计算题）',
  `year` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '题目年份',
  `term` tinyint(1) NULL DEFAULT NULL COMMENT '学期（1上学期 0 下学期）',
  `course_id` bigint(20) NULL DEFAULT NULL COMMENT '课程id',
  `chapter_id` bigint(20) NULL DEFAULT NULL COMMENT '章节id',
  `review_point` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '知识点',
  `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '简要内容（无标签），便于搜索引擎快速搜索',
  `full_content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '完整的内容，包含格式标签',
  `score` int(5) NULL DEFAULT NULL COMMENT '题目分值',
  `audit_status` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'A' COMMENT '题目审核状态（A 审核中,B 通过，C 未通过）',
  `is_use` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否使用（1 使用，0 停用）',
  `order_num` int(4) NULL DEFAULT 1 COMMENT '显示顺序',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 119 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '用户信息表' ROW_FORMAT = DYNAMIC;

